import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faSearch, faShoppingCart } from "@fortawesome/free-solid-svg-icons";
import { Link } from "react-router-dom";

export default function CustomerHeader() {
  return (
    <header className="bg-gradient-to-r from-orange-500 to-red-500 shadow-lg">
      <div className="container mx-auto px-4 flex items-center justify-between h-16">
        <Link to="/" className="text-2xl font-bold text-white">
          Tomato.
        </Link>

        <nav className="hidden md:flex space-x-6">
          {["Home", "Menu", "Mobile App", "Contact Us"].map((item) => (
            <Link
              key={item}
              to={`/${item.replace(" ", "").toLowerCase()}`}
              className="text-white hover:text-yellow-200 transition"
            >
              {item}
            </Link>
          ))}
        </nav>

        <div className="flex items-center space-x-4">
          <button className="text-white hover:text-yellow-200">
            <FontAwesomeIcon icon={faSearch} />
          </button>
          <button className="text-white hover:text-yellow-200">
            <FontAwesomeIcon icon={faShoppingCart} />
          </button>
          <Link
            to="/signin"
            className="px-4 py-1 border border-white text-white rounded hover:bg-white hover:text-red-500 transition"
          >
            Sign in
          </Link>
        </div>
      </div>
    </header>
  );
}
